{

    int i, code = 0;



    /* old way, only for QT? */

    for (i = 0; !mp4 && i < FF_ARRAY_ELEMS(mov_mdhd_language_map); i++) {

        if (mov_mdhd_language_map[i] && !strcmp(lang, mov_mdhd_language_map[i]))

            return i;

    }

    /* XXX:can we do that in mov too? */

    if (!mp4)

        return 0;

    /* handle undefined as such */

    if (lang[0] == '\0')

